import React, { Component } from 'react'

export class CardTimes extends Component {
  input = React.createRef();

  render() {
    return (
      <div>
        <select ref={this.input}>
          {this.props.times.map((x) => <option value={x}> {x}</option>)}
        </select>
        <div>
          <a href={this.props.url+'/?at='+this.input.value} className="btn btn-primary">Submit</a>
        </div>
      </div>
    )
  }
}

export default CardTimes
